CREATE DEFINER=`root`@`localhost` PROCEDURE `ActualizarUsuario` (IN `p_Usua_Nombre` VARCHAR(30), IN `p_Usua_Contra` VARCHAR(30), IN `p_Usua_PubPriv` BOOL, IN `p_Usua_Estatus` BOOL, IN `p_UsIn_Nombre` VARCHAR(30), IN `p_UsIn_ApellidoPa` VARCHAR(30), IN `p_UsIn_ApellidoMa` VARCHAR(30), IN `p_UsIn_Sexo` VARCHAR(25), IN `p_UsIn_Telefono` VARCHAR(20), IN `p_UsIn_Correo` VARCHAR(60), IN `p_UsIn_Foto` BLOB, IN `p_UsIn_Fecha_Nac` DATE, IN `p_UsIn_Fecha_Creac` DATETIME, IN `p_UsIn_Estatus` BOOL)   BEGIN
    DECLARE v_Usua_ID INT;

    -- Obtener el Usua_ID del nombre de usuario
    SELECT Usua_ID INTO v_Usua_ID FROM Usuario WHERE Usua_Nombre = p_Usua_Nombre;

    -- Verificar si se encontró un Usua_ID
    IF v_Usua_ID IS NOT NULL THEN
